import './Middle.css';
import React, { Component } from 'react';

class Middle extends Component {
    constructor(props) {
      super(props);
      this.state = {
        fetchAdd: {
          count: ''
        }
      }
      this.fetchAdd = this.fetchAdd.bind(this);
    }
  

    fetchAdd(o1,o2) {
    const testURL = 'https://localhost:8080/hcl/add/${o1}/${o2}';
	  const myInit = {
		  method: 'GET',
        mode: 'no-cors',
        headers: {
            xhrFields:{}
        }
	  };

    const myRequest = new Request(testURL, myInit);
    
        fetch(myRequest)
          .then( (response) => {
            console.log("response", response);
            this.setState({
              fetchAdd: response.data
            });
            console.log("fetchAdd", this.state.fetchAdd)
          })
          .catch( (error) => {
            console.log(error)
          });
        
    }
 

render() {
    
    return (
      <div>
        <p>add <text name='o1' value='{o1}'/> to 
        <text name='o1' value='{o1}'/> = {this.fetchAdd.count}</p>
        <button onClick={this.fetchAdd({o1},{o2})}>
          Click me
        </button>
      </div>
    );
  }
}
  export default Middle;
